                        <head>
                            {css}
                        </head>
                        <body>
                            {result}
                            {js}
                        </body>
                        </html>";
                await web_1.EnsureCoreWebView2Async();

                web_1.NavigateToString(fullHtml);
            }
            catch (Exception ex)
            {
                MessageBox.Show($"Lỗi: {ex.InnerException?.Message ?? ex.Message}", "Lỗi", MessageBoxButtons.OK, MessageBoxIcon.Error);
            }
        }
    }
}
